import { useState } from "react";
export default ()=>{
    const status =[
        "Order Placed",
        "Pending",
        "Preparing",
        "out for Delivery",
        "Delivered",
    ];
    const [value ,setValue]=useState(0);
    const onClickHandler = ()=>{
        setValue(value+1);
    };
    return(
        <>
        <h1>Online order</h1>
        <div>Current Status:{status[value]}</div>
        <butto onclick={onClickHandler}>Next Status</butto>
        </>
    );
};
